import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, SafeAreaView, FlatList } from "react-native";

export default function App() {
  return (
    <SafeAreaView style={styles.body}>
      <View style={styles.container}>
        <h1>Aplikacja Ratowników Mazowsza</h1>
        <FlatListBasics></FlatListBasics>
        <View>
          <button onClick={basicFunction}>
            <Text>Naciśnij mnie</Text>
          </button>
        </View>
        <StatusBar style="auto" />
      </View>
    </SafeAreaView>
  );
}

function basicFunction() {
  console.log("abc");
}

const FlatListBasics = () => {
  return (
    <View style={styles.users}>
      <FlatList
        data={[
          { key: "Devin", isAvailable: true },
          { key: "Dan", isAvailable: true },
          { key: "Dominic", isAvailable: true },
          { key: "Jackson", isAvailable: true },
          { key: "James", isAvailable: true },
          { key: "Joel", isAvailable: true },
          { key: "John", isAvailable: true },
          { key: "Jillian", isAvailable: true },
          { key: "Jimmy", isAvailable: true },
          { key: "Julie", isAvailable: true },
        ]}
        renderItem={({ item, isAvailable }) => {
          if (isAvailable == true) {
            <Text style={styles.item}>
              {item.key} - <Text style={styles.available}>Dostępny</Text>
            </Text>;
          }
        }}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  body: {
    width: "50%",
    height: "90%",
    borderColor: "red",
    borderWidth: "2px",
    borderRadius: "5px",
    marginLeft: "auto",
    marginRight: "auto",
    backgroundColor: "dodgerblue",
    flex: 1,
  },
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  users: {
    marginBottom: "20px",
  },
  available: {
    color: "green",
  },
});
